		    "293  /*find concrete node, returns a pointer to the node that matches the request*/",
		    "294  /*respectively NULL if the list is empty or if such an item is not found in the list*/ ",
		    "295  LISTnode* findNode(LISTnode* h, int data)",
		    "296  {",
		    "297      while (h != NULL && h->data != data)",
		    "298      {",
		    "299          h = h->next;",
		    "300      }",
		    "301      return h;",
		    "302  }",
