		    "304  /* edit the data of a specific node */",
		    "305  void changeValue(LISTnode* h, int target, int newValue)",
		    "306  {",
		    "307      while (h != NULL && h->data != target)",
		    "308      {",
		    "309          h = h->next;",
		    "310     }",
		    "311      if (h != NULL)",
		    "312      {",
		    "313          h->data = newValue;",
		    "314      }",
		    "315      else",
		    "316      {",
		    "317          printf(\"Node with data %d wasn't found. Nothing change.\\n \", target);",
