		function highlightLinesForFrame(frameNumber) {
		    clearPreviousHighlights();
		
		    var linesToHighlight = frameHighlightMap[frameNumber];
		    if (!linesToHighlight || linesToHighlight.length === 0) return;
		
		    var firstHighlightedLine = Math.min(...linesToHighlight);
		    var lineToAlign = Math.max(0, firstHighlightedLine - 5);
		
		    if (linePositions[lineToAlign] !== undefined) {
		        container.y = 50 - linePositions[lineToAlign];  
		        highlightContainer.y = container.y;  
		    }
		
		    for (var i = 0; i < linesToHighlight.length; i++) {
		        var lineIndex = linesToHighlight[i];
		        var yPos = linePositions[lineIndex] - lineHeight;  
		        createLineHighlight(yPos);
		    }
		
		    stage.update();
		}
		
		function reloadTextContent() {
		    while (container.numChildren > 0) {
		        container.removeChildAt(0);
		    }
		
		    linePositions = [];  
		    yPosition = 30;
		
		    for (var i = 0; i < textArray.length; i++) {
		        var textObjects = createTextWithHighlightedWords(textArray[i]);
		        for (var j = 0; j < textObjects.length; j++) {
		            textObjects[j].y = yPosition;
		            container.addChild(textObjects[j]);
		        }
		        linePositions.push(yPosition);
		        yPosition += lineHeight;
		    }
		
		    container.x = 40;
		    container.y = 50;
		    highlightContainer.x = container.x;
		    highlightContainer.y = container.y;
		
		    var mask = new createjs.Shape();
		    mask.graphics.beginFill("red").drawRect(0, 0, 610, 350);
		    mask.x = 35;
		    mask.y = 60;
		
		    container.mask = mask;
		    highlightContainer.mask = mask;
		
		    stage.update();
		}
		
