		var canScroll = false;
		
		function checkMousePosition(event) {
		    var mouseX = event.stageX;
		    var mouseY = event.stageY;
		
		    canScroll = mouseX >= scrollArea.x && mouseX <= scrollArea.x + 500 &&
		                mouseY >= scrollArea.y && mouseY <= scrollArea.y + 300;
		}
		
		stage.on("stagemousemove", checkMousePosition);
		stage.addChild(scrollArea);
		
		function handleScroll(event) {
		    if (canScroll) {
		        var delta = event.deltaY > 0 ? -20 : 20;
		        container.y = Math.max(Math.min(container.y + delta, minY), maxY);
		        highlightContainer.y = container.y;
		
		        stage.update();
		    }
		}
		
